import logo from './logo.svg';
import './App.css';
import {Login} from "./Components/Login";
import {Route,Routes} from "react-router-dom";
import React from "react";
function App() {
  return (
    <div className="App">
      <Routes>
        <Route path='/' element={<Login/>}></Route>
      </Routes>
    </div>
  );
}

export default App;
